import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import CatApp from './CatApp/CatApp';

function App() {
  return (
    <div>
      <h2>asdfasdf</h2>
      <Link to="/CatApp">CatApp</Link>
      <Router>
        <Routes>
          <Route path="/CatApp/*" element={<CatApp />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
